import NavBar from "./pages/NavBar";
import { InputInfProvider } from "./pages/contexts/EP";

function App(props) {
  return (
    <div className="App">
      <header>
        <InputInfProvider>
          <NavBar />
        </InputInfProvider>
      </header>
      <props.component />
    </div>
  );
}
export default App;
